    "history":"Keanu Charles Reeves nació en Beirut el 2 de septiembre de 1964, hijo de Patricia Taylor, diseñadora de vestuario y artista, y Samuel Nowlin Reeves, Jr.8 Su madre es inglesa, oriunda de Essex.9 Su padre, un estadounidense de Hawái, es de ascendencia china, hawaiana, inglesa, irlandesa y portuguesa. Reeves ha dicho: Mi abuela es china y hawaiana, así que estuve cerca del arte, los muebles y la cocina chinas a medida que crecía. También ha hablado de su ascendencia inglesa, mencionando ver programas de comedia como The Two Ronnies durante su infancia y cómo su madre impartió modales en inglés que mantuvo hasta la edad adulta. La madre de Reeves estaba trabajando en Beirut cuando conoció a su padre.",
